  //   .then (response => response.json())
  //   .then(data => this.setState({Links: data.Book}));
  //   console.log(Book);
  // }

  render() {
    return (
      <div className="icon-img">
        {this.state.Links.map((item, index) => {
          return (
            <a key={index} href={item}>
              <img src={book} alt="something" />
            </a>
          );
        })}
      </div>
    );
  }
}

export default Books;
